import TeacherHeader from "./TeacherHeader";
import { useState, useEffect  } from "react";
import axios from "axios";
import { Link, useParams } from "react-router-dom";
import './TeacherMyCourses.css';

const baseUrl='http://127.0.0.1:8000/api';

function EnrolledStudents() {

    useEffect(()=>{
        document.title='Enrolled Students';
    });

    const [studentData, setStudentData] = useState([]);

   let {course_id}=useParams();
   

   useEffect(()=>{
    try{
        axios.get(baseUrl + '/fetch_enrolled_users/'+ course_id).then((res)=>{
          setStudentData(res.data);
        });
      }catch(error){
        console.log(error);
      }
}, []);
    

console.log(studentData.data.full_name);
    return (
        <>

<table className="table">
  <thead>
    <tr>
      <th scope="col">First</th>
      <th scope="col">Last</th>
      <th scope="col">Handle</th>
      <th scope="col">Handle</th>
    </tr>
  </thead>
  <tbody>
  {studentData && studentData.map((row, index) => 
    <tr key={index}>
      <td>{row.data.full_name}</td>
      <td>{row.data.email}</td>
      <td>{row.data.username}</td>
      <td><button>View</button></td>
    </tr>
  )}
</tbody>
</table>


     
        </>
    );
}
export default EnrolledStudents;
